ccessful Blogging in 2018 So, you want to start a blog? If so, you are in the right place!\",\"summary\":\"<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duis porttitor, ipsum in elementum fermentum, sem lacus posuere tortor, non sodales metus tellus ac nibh. Phasellus vitae tristique nunc. Nulla malesuada et sapien ut varius. Integer ac fermentum urna. Pellentesque nec odio quis leo iaculis cursus et sit amet velit. Vestibulum blandit laoreet euismod. Nam nec nibh elit. Sed placerat interdum libero sed lobortis. Proin dignissim lectus eget tempus sodales. Nulla finibus interdum nibh in pulvinar. Aenean viverra tincidunt dolor, at laoreet dolor bibendum vel. Praesent eu feugiat leo.<\\/p><p>Mauris pulvinar, metus varius accumsan gravida, ex diam maximus augue, eu dictum lacus enim ac lorem. Nunc vel nibh et diam dictum cursus. Vestibulum pulvinar scelerisque est nec pellentesque. Donec eget interdum felis. Maecenas iaculis felis eget diam hendrerit, sit amet consectetur turpis posuere. Nullam nec augue urna. Pellentesque nisi nulla, laoreet at porta in, tincidunt hendrerit nisi.<\\/p><p>Etiam aliquet iaculis magna vel commodo. Sed accumsan enim sit amet enim interdum ullamcorper in at dolor. Mauris id turpis at est egestas congue nec ut erat. Integer vel faucibus enim. Nam accumsan eros in metus gravida scelerisque. Vestibulum eget ex nisi. Aliquam sed ligula diam. Curabitur suscipit ornare ante. Sed malesuada, purus sed tristique mattis, tellus leo venenatis mauris, id sollicitudin nisi quam a nunc. Duis cursus blandit faucibus. Maecenas consequat libero quis dui hendrerit sollicitudin. Nam suscipit fringilla urna sed consequat. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce tincidunt elit ut euismod mollis. Phasellus eu felis ac est feugiat interdum.<\\/p>\",\"slug\":\"the-complete-guide-to-successful-blogging-in-2018-so-you-want-to-start-a-blog-if-so-you-are-in-the-right-place\",\"image\":\"a:2:{i:0;s:34:\\\"Screenshot (13).png_1545392118.png\\\";i:1;s:32:\\\"Chrysanthemum.jpg_1541321119.jpg\\\";}\",\"publish\":1,\"created_at\":\"2018-11-04 08:45:19\",\"updated_at\":\"2018-12-22 03:46:22\",\"images\":[\"Screenshot (13).png_1545392118.png\",\"Chrysanthemum.jpg_1541321119.jpg\"]},{\"id\":4,\"title\":\"10 Things to Make Your Blog Awesomer\",\"summary\":\"<p>I am saying it. <strong>Free stuff, while awesome in its lack of cost, is still just that: a freebie<\\/strong>. Often it is a watered down version of a premium product or a way for someone to advertise themselves. Think about it. That \\u201cfree\\u201d image you are using? You have to link to someone and give them credit. The \\u201cfree\\u201d font service you use? It puts a badge at the bottom of your site.<\\/p><p>Many free services require you to link back to them with either a link or a badge. These links can cause confusion to your readers (what exactly is the point of your site and why are you sending them elsewhere?), and you don\\u2019t want to confuse your visitors.<\\/p><p>\\u201cFree\\u201d images are often not free either. If you are using a photo someone else took without paying for it, are you sure you aren\\u2019t in violation of copyright or the creative commons license under which it was shared?<\\/p><p>One last thing about freebies and blogging: are you still using a free domain for your blog, such as yourname.bloggingservice.com? It is time to grow up and upgrade. These domains look free, which isn\\u2019t a good look for someone blogging for business. Domain names are a nominal cost. If you are using a free domain because you added a blog to your website after it launched, upgrade to the version that lets you use yoursite.com\\/blog. <strong>You gain instant credibility, so what is stopping you?<\\/strong><\\/p>\",\"slug\":\"10-things-to-make-your-blog-awesomer\",\"image\":\"a:1:{i:0;s:11:\\\"noimage.jpg\\\";}\",\"publish\":1,\"created_at\":\"2018-12-21 08:59:53\",\"updated_at\":\"2018-12-22 13:03:18\",\"images\":[\"noimage.jpg\"]}]}}},\"duration\":494,\"hostname\":\"DESKTOP-DNT0A79\"}', '2019-03-12 12:59:54'),
