g Awesomer\",\"summary\":\"<p>I am saying it. <strong>Free stuff, while awesome in its lack of cost, is still just that: a freebie<\\/strong>. Often it is a watered down version of a premium product or a way for someone to advertise themselves. Think about it. That \\u201cfree\\u201d image you are using? You have to link to someone and give them credit. The \\u201cfree\\u201d font service you use? It puts a badge at the bottom of your site.<\\/p><p>Many free services require you to link back to them with either a link or a badge. These links can cause confusion to your readers (what exactly is the point of your site and why are you sending them elsewhere?), and you don\\u2019t want to confuse your visitors.<\\/p><p>\\u201cFree\\u201d images are often not free either. If you are using a photo someone else took without paying for it, are you sure you aren\\u2019t in violation of copyright or the creative commons license under which it was shared?<\\/p><p>One last thing about freebies and blogging: are you still using a free domain for your blog, such as yourname.bloggingservice.com? It is time to grow up and upgrade. These domains look free, which isn\\u2019t a good look for someone blogging for business. Domain names are a nominal cost. If you are using a free domain because you added a blog to your website after it launched, upgrade to the version that lets you use yoursite.com\\/blog. <strong>You gain instant credibility, so what is stopping you?<\\/strong><\\/p>\",\"slug\":\"10-things-to-make-your-blog-awesomer\",\"image\":\"a:1:{i:0;s:11:\\\"noimage.jpg\\\";}\",\"publish\":1,\"created_at\":\"2018-12-21 08:59:53\",\"updated_at\":\"2018-12-22 13:03:18\",\"images\":[\"noimage.jpg\"]}]}]},{\"file\":\"C:\\\\xampp\\\\htdocs\\\\carshowroom\\\\vendor\\\\laravel\\\\framework\\\\src\\\\Illuminate\\\\View\\\\View.php\",\"line\":142,\"function\":\"get\",\"class\":\"Illuminate\\\\View\\\\Engines\\\\CompilerEngine\",\"type\":\"->\",\"args\":[\"C:\\\\xampp\\\\htdocs\\\\carshowr