ntium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere<\\/p>\",\"image\":\"a:1:{i:0;s:26:\\\"laravel.png_1545388611.png\\\";}\",\"publish\":1,\"fontAwesome\":null,\"created_at\":\"2018-12-21 10:36:51\",\"updated_at\":\"2018-12-22 15:35:19\",\"images\":[\"laravel.png_1545388611.png\"]},{\"id\":17,\"page_category_id\":7,\"title\":\"Hello to fellow customer\",\"slug\":\"hello-to-fellow-customer\",\"summary\":\"<p>But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness.&nbsp;<\\/p><p>No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful.&nbsp;<\\/p><p>Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure? On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee&nbsp;<\\/p>\",\"image\":\"a:1:{i:0;s:11:\\\"noimage.jpg\\\";}\",\"publish\":1,\"fontAwesome\":null,\"created_at\":\"2018-12-21 10:44:59\",\"updated_at\":\"2018-12-22 16:02:46\",\"images\":[\"noimage.jpg\"]},{\"id\":18,\"page_category_id\":7,\"title\":\"We are ruling the country\",\"slug\":\"we-are-ruling-the-country\",\"summary\":\"<p>A wonderful serenity has taken possession of my entire soul, like these sweet mornings of spring which I enjoy with my whole heart. I am alone, and feel the charm of existence in this spot, which was created for the bliss of souls like mine. I am so happy, my dear friend, so absorbed in the exquisite sense of mere tranquil existence, that I neglect my talents. I should be incapable of drawing a single stroke at the present moment; and yet I feel that I never was a greater artist than now. When, while the lovely valley teems with vapour around me, and the meridian sun strikes the upper surface of the impenetrable foliage of my trees, and but a few stray gleams steal into the inner sanctuary, I throw myself down among the tall grass by the trickling stream; and, as I lie close to the earth, a thousand unknown plants are noticed by me: when I hear the buzz of the little world among the stalks, and grow familiar with the countless indescribable forms of the insects and flies, then I feel the presence of the Almighty, who formed us in his own image, and the breath&nbsp;<\\/p>\",\"image\":\"a:1:{i:0;s:28:\\\"carbon(3).png_1545389819.png\\\";}\",\"publish\":1,\"fontAwesome\":null,\"created_at\":\"2018-12-21 10:49:24\",\"updated_at\":\"2018-12-21 10:57:20\",\"images\":[\"carbon(3).png_1545389819.png\"]},{\"id\":19,\"page_category_id\":7,\"title\":\"qwerfwerf\",\"slug\":\"qwerfwerf\",\"summary\":\"<p>erfwerf<\\/p>\",\"image\":\"a:1:{i:0;s:11:\\\"noimage.jpg\\\";}\",\"publish\":1,\"fontAwesome\":null,\"created_at\":\"2018-12-23 06:33:30\",\"updated_at\":\"2018-12-23 06:33:30\",\"images\":[\"noimage.jpg\"]}],\"our_services\":[{\"id\":1,\"title\":\"Informational security\",\"description\":\"<p>We\\u